import React, { useState } from "react";
import { Redirect } from "react-router-dom";
import "./Heading.css";
function Navbar2() {
  const [LogOut, setLogOut] = useState(false);
  const [faucet, setFaucet] = useState(false);
  function logOut() {
    localStorage.clear();
    setLogOut(true);
  }
  function handleFaucet() {
    setFaucet(true);
  }
  return (
    <div className="heading3">
      {/* <button className="log-out" onClick={logOut}>
        LOG OUT
      </button> */}
      {/* <button className="log-out" onClick={handleFaucet}>
        Donation Token Faucet
      </button> */}
      {/* <button className="button-64 two-btns" type="submit" onClick={handleFaucet} >
        <span className="text">Donation Token Faucet</span>
      </button> */}
      <button
        className="variable-width-btn-1 button-su fund-campaign-btn"
        onClick={logOut}
      >
        LOG OUT
      </button>
      <button
        className="variable-width-btn-1 button-su fund-campaign-btn"
        onClick={handleFaucet}
      >
        DONATION TOKEN FAUCET
      </button>
      {LogOut && <Redirect to="/landingPage" />}
      {faucet && <Redirect to="/tokenFaucet" />}
    </div>
  );
}
export default Navbar2;
